01) FALTA PROVIDENCIAR A ATUALIZAÇÃO DE ENDEREÇO DO ESTABELECIMENTO JUNTO AO CADASTRO ECONOMICO MUNICIPAL DA PREFEITURA DE ANÁPOLIS;
02) PROTOCOLAR JUNTO A VISA MUNICIPAL DE ANAPOLIS, O CADASTRO ATUALIZADO DO ESTABELECIMENTO (COPIA DO CADASTRO/INSCRIÇÃO MUNICIPAL, CARTÃO CNPJ E DA ALTERAÇÃO DO CONTRATO SOCIAL) CONSTANDO OS DADOS OU INFORMAÇÕES ATUALIZADAS DO ENDEREÇO DO ESTABELECIMENTO.
